"use strict";(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[2056],{62056:e=>{e.exports=JSON.parse('{"java":{"language":"java","code":"class Solution {\\n    public int scheduleCourse(int[][] courses) {\\n        Arrays.sort(courses, (a, b) -> a[1]-b[1]);\\n        PriorityQueue<Integer> pq = new PriorityQueue<>((a,b) ->b-a);\\n        int time = 0;\\n        for(int[] c: courses) {\\n            if (time + c[0] <= c[1]) {\\n                time += c[0];\\n                pq.offer(c[0]);\\n            } else if (!pq.isEmpty() && pq.peek() > c[0]){\\n                time += c[0] - pq.poll();\\n                pq.offer(c[0]);\\n            }\\n        }\\n        return pq.size();\\n    }\\n}","subPath":"","fileName":"solution.java"}}')}}]);